    true,nt"url": null,nt"notes": "<p>The Sexually Transmitted Disease (STD)
    Morbidity online databases on CDC WONDER contain case reports reported from the
    50 United States and D.C., Puerto Rico, Virgin Islands and Guam. The online databases
    report the number of cases and disease incidence rates by year, state, disease,
    age, gender of patient, type of STD, and area of report, since 1984. Data are updated
    annually. Data are produced by the U.S. Department of Health and Human Services,
    Public Health Service, Centers for Disease Control and Prevention (CDC), National
    Center for HIV/AIDS, viral Hepatitis, STD and TB Prevention (NCHHSTP).</p>n",nt"license_title":
